import BottomNavigation from '@material-ui/core/BottomNavigation';
import React, { Component } from 'react';


class BottomBar extends React.Component{
    render(){
     return(
        <BottomNavigation 
        showLabels
        className="nav primary"
        />



    );
}
}
export default BottomBar;
